import React, { Component } from 'react';

export class Management extends Component {
    state = {  }

    styles = {
        header: {
            color: 'red',
            fontSize: 35
        },
        subheader: {
            color: 'red',
            fontSize: 25
        },
        bold: {
            fontWeight: 'bold'
        },
        blue: {
            color: '#1cb7e6',
            fontSize: 50
        }
    }

    render() { 
        return ( 
            <div class="ml-4">
                <span class="txt heading-2" style={this.styles.blue}>+ </span>
                <span class="txt heading-3" style={this.styles.subheader}>Management Team</span>
            </div>
        );
    }
}
